import React from "react";
import { work } from "../../data/work";

export const Work = () => {
  return (
    <div className="mt-32 pb-10">
      <h1 className="text-6xl font-bold">My Work</h1>
      <div className="mt-32">
        {work.map((w) => (
          <div>
            <div className="w-1/3 flex flex-col">
              <div className="my-10">
                <h1 className="text-5xl">{w.name}</h1>
              </div>
              <p className="text text-xl">{w.description}</p>
              <p className="text text-xl">{w.additional}</p>
              <div className="my-10">
                <a href={w.link}>
                  <span>{w.name}</span>
                </a>
              </div>
            </div>
            <div className="w-2/3"></div>
          </div>
        ))}
      </div>
    </div>
  );
};
